"use strict"

import { StyleSheet, Text, View } from "react-native";

const DataScreen = () => {
        return (
            <View style={styles.container} >
                <Text>Data</Text>
            </View>
        )

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        alignItems: 'center',
        marginBottom: 10,
    }
})

export default DataScreen;
